import React, { Component } from "react";
import "./home.css";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Navbar from "./navbar";
import Tagline from "./tagline";
import Code from "./navs/code";
import Notes from "./navs/notes";
import Otaku from "./navs/otaku";
import Contact from "./navs/contact";

class Home extends Component {

  authenticate(){
  return new Promise(resolve => setTimeout(resolve, 1100)) // 1.1 second
  }

  componentDidMount(){
  this.authenticate().then(() => {
    const e = document.getElementById('loader-wrapper')
    if(e){
      //fade out
      e.classList.add('available')
      setTimeout(() => {
        //remove from DOM
        e.outerHTML = ''
      }, 1000)
    }
  })}

  render() {
    return (
      <div className="tc">
        <div className="grow ba">
          <img src="./images/profile.png" alt="avatar"/>
        </div>
        <Tagline />
        <Navbar className="name" />
      </div>
    );
  }
}

export default Home;
